import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 15.2-3528 Appeals.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-3528.md","filePath":"vacode/15.2-3528.md"}'),o={name:"vacode/15.2-3528.md"},p=r('<h1 id="§-15-2-3528-appeals" tabindex="-1">§ 15.2-3528 Appeals. <a class="header-anchor" href="#§-15-2-3528-appeals" aria-label="Permalink to &quot;§ 15.2-3528 Appeals.&quot;">​</a></h1><p>Appeals may be made to the Court of Appeals as provided in §§ <a href="/vacode/15.2-3221/">15.2-3221</a> and <a href="/vacode/15.2-3222/">15.2-3222</a>, which shall apply mutatis mutandis. Any judgment of the Court of Appeals rendered pursuant to this section may be appealed to the Supreme Court, which, if it grants the petition for appeal, shall hear the appeal as provided in §§ <a href="/vacode/15.2-3221/">15.2-3221</a> and <a href="/vacode/15.2-3222/">15.2-3222</a>, which shall apply mutatis mutandis.</p><p>1979, c. 85, § 15.1-1130.10; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0587" target="_blank" rel="noreferrer">587</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0489" target="_blank" rel="noreferrer">489</a>.</p>',3),s=[p];function i(l,n,c,d,h,_){return a(),t("div",null,s)}const m=e(o,[["render",i]]);export{u as __pageData,m as default};
